script: |
  super -f text -I q4663.spq | sort > q4663.out

inputs:
  - name: q4663.spq
    data: |
      SELECT ALL + 84 FROM tab2 (FORMAT parquet) WHERE NOT ( NULL ) NOT IN ( - col2 / col1 ) OR + col2 + col2 * col0 IS NOT NULL;
  - name: tab2

outputs:
  - name: q4663.out
    data: |
      84
      84
      84
